import React, { useState } from 'react'
import Card from './Card'
import CetogaryData from './categoryApi'
const Category = () => {
  const [data,setdata]=useState(CetogaryData);
  return (
    <>
      <h1>Category</h1>
      <div className="container-fluid mx-2">
        <div className="row mt-5 mx-2">
          <div className="col-md-3">
            <button type="button" class="btn btn-success w-100 mb-4">All Product</button>
            <button type="button" class="btn btn-success w-100 mb-4">Perfume Oil</button>
            <button type="button" class="btn btn-success w-100 mb-4">Perfume Glass</button>
            <button type="button" class="btn btn-success w-100 mb-4">Skin Care</button>
            <button type="button" class="btn btn-success w-100 mb-4">Body Care</button>

          </div>
          <div className="col-md-9">
            <div className="row">
            {data.map((values)=>{
              const {id,title,image}=values;
                            return(
                                <>
                                <Card/>
                                </>
                            )
                        })}
            </div>
          </div>
        </div>
      </div>
    </>
  )
}

export default Category
